import React from "react";
import ReactDOM from "react-dom";
import Button from "./Button";

const TodoList = () => {
  return (
    <div className="filters btn-group stack-execption">
      <Button
        type="button"
        className="btn toggle-btn"
        ariaPressed="true"
      ></Button>
      <Button
        type="button"
        className="btn toggle-btn"
        ariaPressed="false"
      ></Button>
      <Button
        type="button"
        className="btn toggle-btn"
        ariaPressed="false"
      ></Button>
    </div>
  );
};

export default TodoList;
